    def key_name(self, aData):
        return aApi.gets(aData, 'name')

    def key_price(self, aData):
        Price = aApi.gets(aData, 'offers.price')
        Cur = aApi.gets(aData, 'offers.priceCurrency')
        return [Price, Cur]

    def key_image(self, aData):
        Image = aApi.gets(aData, 'image')
        if (Image):
            return Image[0]

    def key_stock(self, aData):
        Val = aApi.gets(aData, 'offers.availability')
        return aApi.stock(Val)

    def key_mpn(self, aData):
        return aApi.gets(aData, 'mpn')

